import { useHistory } from 'react-router-dom'

const View = () => {
    const history=useHistory()
    return (
        <>
            <h3>Sorry...
                No user logged in yet.
            </h3>

            <h4>Please <a className="text-success" onClick={()=>{history.push('/login')}}>click here</a> to login</h4>
        </>
    )
}

export default View
